import React from "react";
import Header from '../../components/Header';
import Main from '../../components/Main';

const Home = () =>{
    return(
        <>
            <header className="App-header">
                <Header></Header>
            </header>

            <main>
                <Main></Main>
            </main>

            <footer>
                <h2>DESENVOLVIDO POR JOAO MANOEL</h2>
            </footer>
        </>
    );
}

export default Home;
